var moment=require("../../moment");exports.leapyear={setUp:function(b){moment.createFromInputFallback=function(){throw new Error("input not handled by moment")};b()},"leap year":function(b){b.expect(4);b.equal(moment([2010,0,1]).isLeapYear(),false,"2010");b.equal(moment([2100,0,1]).isLeapYear(),false,"2100");b.equal(moment([2008,0,1]).isLeapYear(),true,"2008");b.equal(moment([2000,0,1]).isLeapYear(),true,"2000");b.done()}};